import React from "react"; 
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Terry Agabi</h1>
          <p>Welcome to Terry Agabi website.</p>
        <a
          className="App-link"
          href="https://www.linkedin.com/in/terryagabi/"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
